import axios from 'axios';

const DeckAPI = async () => {
  try {
    let res = await fetch(
      'https://deckofcardsapi.com/api/deck/new/shuffle/?deck_count=14'
    );
    const json = await res.json();
    return json.deck_id;
  } catch (err) {
    console.error(err);
  }
};

export default DeckAPI;
